from collections import defaultdict
class Solution(object):
    def peopleIndexes(self, favoriteCompanies):
        """
        :type favoriteCompanies: List[List[str]]
        :rtype: List[int]
        """
        dic =defaultdict(list)
        for i,ls in enumerate(favoriteCompanies):
            for a in ls:
                dic[a].append(i)
        res =[]
        def getNoInclude(cands):
            res =[]
            setCand = []
            for cand in cands:
                setCand.append([set(cand[0]),cand[1]])
            while setCand:
                cand = setCand[0]
                tp =[]
                res.append(cand[1])
                for i in range(1,len(setCand)):
                    tc = setCand[i]
                    tcs = tc[0]
                    print("tcs before: ", tcs , " index ", tc[1])
                    for c in cand[0]:
                        tcs.discard(c)
                    if len(tcs) >0:
                        tp.append([tcs,tc[1]])
                    print("tcs after :", tcs)
                tp = sorted(tp, key= lambda x :-len(x[0]))
                setCand =tp
            return res
        res =set()
        for k,v in dic.items():
            
            cand = []
            for i in v:
                cand.append([list(favoriteCompanies[i]),i])
            cand = sorted(cand,key= lambda x: -len(x[0]))
            if k == "jhmzjrejejrdjqdyygom":
                print(cand)
            #print(len(cand),v)
            #print(getNoInclude(cand)," not include")
            res = res.union(set(getNoInclude(cand)))
        return sorted(list(res))

